import { Component } from "react";

export class Form extends Component {
  state = {
    name: "",
  };
  render() {
    return (
      <form>
        <label>
          <input
            type="text"
            placeholder="name"
            onChange={this.handleNameChange}
            value={this.state.name}
          />
        </label>
      </form>
    );
  }
}
